		init = function(){
			if (_lvl.object1 != undefined) {
				//zistenie objectu s najvyssim cislom, podla toho sa urci pocet
				for (var i=1; i<=50; i++) {
					if (_lvl["object"+i] != undefined && _lvl["object"+(i+1)] == undefined) {
						pocet = i;
					}
					if(_lvl["ulobject"+i] != undefined || _lvl["usobject"+i] != undefined)
						pocet2 = i;
					
					if(_lvl["button"+i] != undefined)
						_lvl["button"+i].cursor = "arrow";
					if(_lvl["nbutton"+i] != undefined)
						_lvl["nbutton"+i].cursor = "arrow";
					if(_lvl["usbutton"+i] != undefined)
						_lvl["usbutton"+i].cursor = "arrow";
					if(_lvl["ulbutton"+i] != undefined)
						_lvl["ulbutton"+i].cursor = "arrow";
					if(_lvl["buttonsecond"+i] != undefined)
						_lvl["buttonsecond"+i].cursor = "arrow";
					if(_lvl["buttonthird"+i] != undefined)
						_lvl["buttonthird"+i].cursor = "arrow";
				}
		
				//zistenie v ktorom frame sme (ak niesme v poslednom, teda v loss obrazovke)
				if (exportRoot.currentFrame < exportRoot.totalFrames - 1) {
					exportRoot.levelframe = exportRoot.currentFrame;
				}
		
				//zistenie framu timeloss objektu
				if(_lvl.timeloss){
					_lvl.timeloss.gotoAndPlay("frame");
					_lvl.tl = _lvl.timeloss.currentFrame;
				}
		
				for (var a=1; a<=pocet; a++) {
					//zistenie posledneho 'frameu' nesplnenej
					if(_lvl["object"+a]){
						_lvl["Obf"+a] = _lvl["object"+a].timeline._labels.frame;
						//zistenie framu 'release'
						_lvl["Obp"+a] = _lvl["object"+a].timeline._labels.release;
					}
				}
		
		
				//pociatocne ustanovenia
				for (a=1; a<=pocet; a++) {
					if(_lvl["button"+a])
						_lvl["button"+a].visible = true;
					if(_lvl["object"+a])
						_lvl["object"+a].gotoAndPlay(0);
					if(_lvl.loss)
						_lvl.loss.gotoAndPlay(0);
					if(_lvl.timeloss)
						_lvl.timeloss.gotoAndPlay(0);
				}
				for (b=1; b<=pocet2; b++) {
					if(_lvl["usobject"+b])
						_lvl["usobject"+b].gotoAndPlay(0);
					if(_lvl["ulobject"+b])
						_lvl["ulobject"+b].gotoAndPlay(0);
				}
				setTimeout(function(){
					for (a=1; a<=pocet; a++) {
						if(_lvl["button"+a])
							_lvl["button"+a].visible = true;
						if(_lvl["object"+a])
							_lvl["object"+a].gotoAndStop(0);
						if(_lvl.loss)
							_lvl.loss.gotoAndStop(0);
						if(_lvl.timeloss)
							_lvl.timeloss.gotoAndPlay(0);
					}
					for (b=1; b<=pocet2; b++) {
						if(_lvl["usobject"+b])
							_lvl["usobject"+b].gotoAndStop(0);
						if(_lvl["ulobject"+b])
							_lvl["ulobject"+b].gotoAndStop(0);
					}
				},40);
			}
			
			//vytvorenie kurzoru 
			myCursor = new lib.cursor();
			stage.addChild(myCursor);
			exportRoot.setChildIndex(myCursor,exportRoot.numChildren-1);
			setTimeout(function(){
				stage.addEventListener("tick",onEnterFrame);
				stage.addEventListener("mousedown",onMouseDown);
			},300);
		}
		
		onEnterFrame = function(event) {
			if(exportRoot.menuF.visible==false && exportRoot.loss.visible==false){
				
				myCursor.x = stage.mouseX;
				myCursor.y = stage.mouseY;
				//ak nieje ziaden object1
				if (_lvl.object1 != undefined) {
					//ak existuje timeloss object na scene
				
					if (_lvl.tl != undefined && _lvl.timeloss) {
						//ak timeloss dosiel do konca potom zapamataj kde skoncil a loss obrazovka
						if (_lvl.timeloss.currentFrame == _lvl.tl && _lvl.object1.currentFrame <= _lvl.Obf1) {
								exportRoot.loss.visible=true;	
								exportRoot.loss.loss.gotoAndPlay(5);
							//exportRoot.gotoAndPlay(exportRoot.totalFrames - 1);
						}
					}
					//trace("T2");
					//ak klikol na lossbutton potom ho hraj 
					if (_lvl.lossbutton && hitTestObject(myCursor, _lvl.lossbutton) && myCursor.currentFrame == 1) {
						_lvl.loss.play();
					}
					//trace("T3");
					//ak existuje loss
					if (_lvl.loss != undefined) {
					//ak sa dokoncila animacia loss potom loss screen 
						if (_lvl.loss.currentFrame == _lvl.loss.totalFrames - 1) {
							console.log("lossSc");
							exportRoot.loss.visible=true;
							exportRoot.loss.loss.gotoAndPlay(5);
						//	exportRoot.gotoAndStop(29);
						//	exportRoot.gotoAndPlay(exportRoot.totalFrames - 1);
						}
					}
					//trace("T4");
					for (var a=1; a<=10; a++) {
						//ak klikol nepotrebne button hraj nepotrebny object
						if (_lvl["nbutton"+a] && hitTestObject(myCursor, _lvl["nbutton"+a]) && myCursor.currentFrame == 1) {
							_lvl["nobject"+a].play();
						}
						if (_lvl["usbutton"+a] && hitTestObject(myCursor, _lvl["usbutton"+a]) && myCursor.currentFrame == 1) {
							_lvl["usobject"+a].play();
						}
						if (_lvl["ulbutton"+a] && hitTestObject(myCursor, _lvl["ulbutton"+a]) && myCursor.currentFrame == 1) {
							_lvl["ulobject"+a].play();
						}
						//ak je nobject v poslednom frame tak daj button het 
						if (_lvl["nobject"+a] && _lvl["nobject"+a].currentFrame == _lvl["nobject"+a].totalFrames - 1) {
							_lvl["nbutton"+a].y = -500;
						}
						//ak je usobject v poslednom frame tak daj button het 
						if (_lvl["usobject"+a] && _lvl["usobject"+a].currentFrame == _lvl["usobject"+a].totalFrames - 1) {
							_lvl["usobject"+a].stop();
							_lvl["usbutton"+a].y = -500;
						}
						//ak je ulobject v poslednom frame tak ho stopni 
						if (_lvl["ulobject"+a] && _lvl["ulobject"+a].currentFrame == _lvl["ulobject"+a].totalFrames - 1) {
							_lvl["ulobject"+a].gotoAndStop(0);
						}
					}
					//trace("T5");
					for (a=1; a<=pocet; a++) {
						//prvyframe stoj
						if (_lvl["object"+a] && _lvl["object"+a].currentFrame == 0) {
							_lvl["object"+a].stop();
						}
						//ked dojde na koniec tak stop 
						if (_lvl["object"+a] && _lvl["object"+a].currentFrame == _lvl["object"+a].totalFrames - 1) {
							_lvl["object"+a].stop();
						}
						//z nesplnenej animacie chod na zaciatocnu slucku 
						if (_lvl["object"+a] && _lvl["object"+a].currentFrame == _lvl["Obf"+a]) {
							_lvl["object"+a].gotoAndStop(0);
						}
						//ak klikol button 
						if (_lvl["object"+a] && _lvl["object"+a].currentFrame<=1) {
							if (((_lvl["button"+a] && hitTestObject(myCursor, _lvl["button"+a])) || (_lvl["buttonsecond"+a] && hitTestObject(myCursor, _lvl["buttonsecond"+a])) || (_lvl["buttonthird"+a] && hitTestObject(myCursor, _lvl["buttonthird"+a]))) && myCursor.currentFrame == 1) {
								//ak je vyssi Ob releasea ALEBO je to posledny object
								if ((_lvl["object"+(a+1)] && _lvl["object"+(a+1)].currentFrame>=_lvl["Obp"+(a+1)]) || a == pocet) {
									//tento Ob hraj Splnenie
									_lvl["object"+a].gotoAndPlay(_lvl["Obf"+a]+1);
									if(_lvl["button"+a])
										_lvl["button"+a].visible = false;
									if(_lvl["buttonsecond"+a])
										_lvl["buttonsecond"+a].visible = false;
									if(_lvl["buttonthird"+a])
										_lvl["buttonthird"+a].visible = false;
								}
								if (a<pocet) {
									//ak je vyssi Ob este nereleaseil alebo timeloss je po frame
									if (_lvl["object"+(a+1)] && _lvl["object"+(a+1)].currentFrame<_lvl["Obp"+(a+1)]) {
										//tento Ob hraj Nesplnenie
										_lvl["object"+a].gotoAndPlay(1);
									}
								}
							}
						}
					}
					//trace("T6");
					//ak posledny object je na konci potom ide do dalsieho levelu
					if (_lvl.object1.currentFrame == _lvl.object1.totalFrames - 1 && exportRoot.currentFrame < 28) {
						exportRoot.continuePopup.visible = true;
					}
				}
			}
		};
		
